import React from 'react'
import dynamic from 'next/dynamic';


export default class LocalScene {
    AFRAME = dynamic(
        // @ts-ignore
      () => {
            // @ts-ignore
            import('aframe')
      },
      { ssr: false }
    )

    render() {
        return (
            <div >
                <a-scene renderer="antialias: true" background="color: #FAFAFA">
                    <a-box
                        position="-1 0.5 -3"
                        rotation="0 45 0"
                        color="#4CC3D9"
                        shadow
                    ></a-box>
                </a-scene>
            </div>
        )
    }
}
